  return (
    <aside className="sidebar">
      <img src={profilePic} alt="Profile" className="profile-pic" />
      <h2>Harshita Pasumarthy</h2>
      <h3>Data Engineer</h3>
      <p>Texas, USA</p>
      <p><Link to={"https://www.linkedin.com/in/harshita-pasumarthy-154933118/"}/>LinkedIn</p>
      <p>Github</p>
    </aside>
  );
};

export default Sidebar;
